// SPDX-License-Identifier: MIT
pragma solidity 0.8.12;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "./IFactory.sol";

contract GalNFT is ERC721URIStorage, AccessControl {
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    address public factoryAddress;
    string data = "GAL";
    string[] private serials;
    string intials;
    string text;
    address adminsuper = 0xa94cF709D7fd3B6E5507Ae25A6229f353A6901b3;
    uint256 adminFee;
    uint256 prices = 20;

    //    https://ipfs.io/ipfs/QmYuKY45Aq87LeL1R5dhb1hqHLp6ZFbJaCP8jxqKM1MX6y/babe_ruth_1.json


    constructor(
        string memory _name,
        string memory _symbol,
        uint256 fee,
        address admin,
        address factory,
        string memory initial
    ) ERC721(_name, _symbol) {
        _setupRole(DEFAULT_ADMIN_ROLE, admin);
        _setupRole(ADMIN_ROLE, admin);
        factoryAddress = factory;
        adminFee = fee;
        intials = initial;
    }

    function mint(
        address to,
        uint256 tokenId,
        string memory TOKEN_URI,
        address token,
        uint256 price,
        uint256 profit,
        bool check
    ) public onlyRole(ADMIN_ROLE) {

        _safeMint(to, tokenId);
        _setTokenURI(tokenId, TOKEN_URI);
        IFACTORY fa = IFACTORY(factoryAddress);
        text = string.concat(data, intials, Strings.toString(tokenId));
        fa.updateSerialMap(text, address(this), tokenId);

        if (check) {
            IERC20(token).transferFrom(payable(msg.sender), adminsuper, prices);
            transferFrom(msg.sender, adminsuper, tokenId);
        }
    }

    function burn(uint256 burnTokenId) public onlyRole(ADMIN_ROLE) {
        _burn(burnTokenId);
    }

    function supportsInterface(bytes4 _interfaceId)
        public
        view
        virtual
        override(ERC721, AccessControl)
        returns (bool)
    {
        return
            _interfaceId == type(IERC721).interfaceId ||
            super.supportsInterface(_interfaceId);
    }
}
